<h1 class="Section4">
<a class="Section5" href="#" id="introduction">Introduction</a>
</h1>
<div class="Section6"><br><b>8051 </b>est l'un des microcontrôleurs à usage général les plus populaires actuellement utilisés. Le succès du 8051 a engendré un certain nombre de clones, qui sont collectivement appelés la famille de microcontrôleurs MCS-51, qui comprend des puces de fournisseurs tels qu'Atmel, Philips, Infineon et Texas Instruments.&nbsp;Le 8051 est un microcontrôleur 8 bits, ce qui signifie que la plupart des opérations disponibles sont limitées à 8 bits. Il existe 3 tailles de base du 8051 : Court, Standard et Etendu. Les puces Short et Standard sont souvent disponibles sous forme DIP (boîtier double en ligne), mais les modèles Extended 8051 ont souvent un facteur de forme différent et ne sont pas compatibles drop-in. Toutes ces puces sont appelées 8051 car elles peuvent toutes être programmées en utilisant le langage d'assemblage 8051, et elles partagent toutes certaines caractéristiques (bien que les différents modèles aient tous leurs propres caractéristiques spéciales).&nbsp;Les variantes du 8051 peuvent également avoir un certain nombre de fonctionnalités spéciales spécifiques au modèle, telles que UART, ADC, AOP, I2C, CAN, SPI, ce qui en fait un microcontrôleur encore plus puissant.&nbsp;Les puces 8051 sont utilisées dans une grande variété de systèmes de contrôle, d'applications de télécommunications, de robotique ainsi que dans l'industrie automobile. Selon certaines estimations, les puces de la famille 8051 représentent plus de 50% du marché des puces embarquées.<br><br><div class="GImg1 Img1"><img alt="image.png" src="data:image/png;base64,"></div><br></div>
</div>
</div>
