</div>
<div class="GSummary21 Summary4">
<i class="Summary5 fa fa-book"></i>
<a class="Summary6" href="#ordonnanceur-multitache-temps-reel--scheduler-_inversion-d-une-broche-toutes-les-200ms">Inversion d'une broche toutes les 200ms</a>
</div>
<div class="GSummary21 Summary4">
<i class="Summary5 fa fa-book"></i>
<a class="Summary6" href="#systeme-d-exploitation-embarque-simple--seos-_inversion-d-une-broche-toutes-les-500ms">Inversion d'une broche toutes les 500ms</a>
</div>
</div><br><h2 class="GTitle1 Title1">
<a class="Title2" id="ordonnanceur-multitache-temps-reel--scheduler-_initialisation-du-systeme-sch" href="#ordonnanceur-multitache-temps-reel--scheduler-">Initialisation du système SCH</a>
</h2><br>Initialisation du système SCH:<br>&nbsp;<br><pre class="GCode1 Code1 AceCode" data-mode="c_cpp" data-theme="gruvbox" data-bg-color="transparent" style="background-color: transparent;">//===============================================
// GInclude.h
//===============================================
#define OSC_FREQ (11059200UL)
#define OSC_PER_INST (12)
//===============================================
// GSch.c
//===============================================
#define PRELOAD(ms) (65536 - ((OSC_FREQ * ms) / (OSC_PER_INST * 1000))) 
#define PRELOAD_H(ms) (PRELOAD(ms) / 256)
#define PRELOAD_L(ms) (PRELOAD(ms) % 256)
//===============================================
#define SCH_MAX_TASKS (1)
//===============================================
typedef struct _sGTask sGTask;
//===============================================
struct _sGTask {
    void (*m_pTask)();
    uint m_delay;
    uint m_period;
    uchar m_runMe;
};
//===============================================
sGTask gTaskMap[SCH_MAX_TASKS];
//===============================================
void GSch_init(uchar _ms) {
    uchar lIndex;
    for(lIndex = 0; lIndex &lt; SCH_MAX_TASKS; lIndex++) {
        GSch_deleteTask(lIndex);
    }
    T2CON = 0x00; 
    TH2 = PRELOAD_H(_ms); 
    TL2 = PRELOAD_L(_ms); 
    RCAP2H = PRELOAD_H(_ms); 
    RCAP2L = PRELOAD_L(_ms);
    TF2 = 0;
    ET2 = 1;
    TR2 = 1;
}
//===============================================</pre><br><h2 class="GTitle1 Title1">
<a class="Title2" id="ordonnanceur-multitache-temps-reel--scheduler-_suppression-d-une-tache-du-systeme-sch" href="#ordonnanceur-multitache-temps-reel--scheduler-">Suppression d'une tâche du système SCH</a>
</h2><br>Suppression d'une tâche du système SCH:&nbsp;<br><br><pre class="GCode1 Code1 AceCode" data-mode="c_cpp" data-theme="gruvbox" data-bg-color="transparent" style="background-color: transparent;">//===============================================
// GSch.c
//===============================================
static void GSch_deleteTask(uchar _index) {
    gTaskMap[_index].m_pTask = 0x0000;
    gTaskMap[_index].m_delay = 0;
    gTaskMap[_index].m_period = 0;
    gTaskMap[_index].m_runMe = 0;
}
//===============================================</pre><br><h2 class="GTitle1 Title1">
<a class="Title2" id="ordonnanceur-multitache-temps-reel--scheduler-_ajout-d-une-tache-dans-le-systeme-sch" href="#ordonnanceur-multitache-temps-reel--scheduler-">Ajout d'une tâche dans le système SCH</a>
</h2><br>Ajout d'une tâche dans le système SCH:&nbsp;<br><br><pre class="GCode1 Code1 AceCode" data-mode="c_cpp" data-theme="gruvbox" data-bg-color="transparent" style="background-color: transparent;">//===============================================
// GSch.c
//===============================================
void GSch_addTask(void (*_pTask)(), const uint _delay, const uint _period) {
    uchar lIndex = 0;
    while((gTaskMap[lIndex].m_pTask != 0) &amp;&amp; (lIndex &lt; SCH_MAX_TASKS)) lIndex++;
    if(lIndex == SCH_MAX_TASKS) return;
    gTaskMap[lIndex].m_pTask = _pTask;
    gTaskMap[lIndex].m_delay = _delay;
    gTaskMap[lIndex].m_period = _period;
    gTaskMap[lIndex].m_runMe = 0;
}
//===============================================</pre><br><h2 class="GTitle1 Title1">
<a class="Title2" id="ordonnanceur-multitache-temps-reel--scheduler-_demarrage-du-systeme-sch" href="#ordonnanceur-multitache-temps-reel--scheduler-">Démarrage du système SCH</a>
</h2><br>Démarrage du système SCH:<br>&nbsp;<br><pre class="GCode1 Code1 AceCode" data-mode="c_cpp" data-theme="gruvbox" data-bg-color="transparent" style="background-color: transparent;">//===============================================
// GSch.c
//===============================================
void GSch_start() {
    EA = 1;
}
//===============================================</pre><br><h2 class="GTitle1 Title1">
<a class="Title2" id="ordonnanceur-multitache-temps-reel--scheduler-_mise-en-veille-du-systeme-sch" href="#ordonnanceur-multitache-temps-reel--scheduler-">Mise en veille du système SCH</a>
</h2><br>Mise en veille du système SCH:<br>&nbsp;<br><pre class="GCode1 Code1 AceCode" data-mode="c_cpp" data-theme="gruvbox" data-bg-color="transparent" style="background-color: transparent;">//===============================================
// GSch.c
//===============================================
static void GSch_goToSleep() {
    PCON |= 0x01;
}
//===============================================</pre><br><h2 class="GTitle1 Title1">
<a class="Title2" id="ordonnanceur-multitache-temps-reel--scheduler-_repartiteur-des-taches-du-systeme-sch" href="#ordonnanceur-multitache-temps-reel--scheduler-">Répartiteur des tâches du système SCH</a>
</h2><br>Répartiteur des tâches du système SCH:<br><br><pre class="GCode1 Code1 AceCode" data-mode="c_cpp" data-theme="gruvbox" data-bg-color="transparent" style="background-color: transparent;">//===============================================
// GSch.c
//===============================================
void GSch_dispatchTasks() {
    uchar lIndex;
    for(lIndex = 0; lIndex &lt; SCH_MAX_TASKS; lIndex++) {
        if(gTaskMap[lIndex].m_runMe &gt; 0) {
            (*gTaskMap[lIndex].m_pTask)();
            gTaskMap[lIndex].m_runMe -= 1;
            if(gTaskMap[lIndex].m_period == 0) {
                GSch_deleteTask(lIndex);
            }
        }
    }
    GSch_goToSleep();
}
//===============================================</pre>&nbsp;<br><h2 class="GTitle1 Title1">
<a class="Title2" id="ordonnanceur-multitache-temps-reel--scheduler-_mise-a-jour-des-taches-du-systeme-sch" href="#ordonnanceur-multitache-temps-reel--scheduler-">Mise à jour des tâches du système SCH</a>
</h2><br>Mise à jour des tâches du système SCH:<br>&nbsp;<br><pre class="GCode1 Code1 AceCode" data-mode="c_cpp" data-theme="gruvbox" data-bg-color="transparent" style="background-color: transparent;">//===============================================
// GSch.c
//===============================================
static void GSch_update() interrupt 5 {
    uchar lIndex;
    TF2 = 0;
    for(lIndex = 0; lIndex &lt; SCH_MAX_TASKS; lIndex++) {
        if(gTaskMap[lIndex].m_pTask != 0) {
            if(gTaskMap[lIndex].m_delay == 0) {
                gTaskMap[lIndex].m_runMe += 1;
                if(gTaskMap[lIndex].m_period != 0) {
                    gTaskMap[lIndex].m_delay = gTaskMap[lIndex].m_period;
                }
            }
            else {
                gTaskMap[lIndex].m_delay -= 1;
