void GClock_updateDP() {
    DP_PIN = !DP_PIN;
}
//===============================================
void GClock_updateSecond() {
    gData.m_second++;
    if(gData.m_second == 60) {
        gData.m_second = 0;
        gData.m_minute++;
    }
    if(gData.m_minute == 60) {
        gData.m_minute = 0;
        gData.m_hour++;
    }
    if(gData.m_hour == 24) {
        gData.m_hour = 0;
    }
